import React from 'react';
import './Scouting.css';



class Scouting extends React.Component {

    


    constructor (props){
        super(props);
        this.state = {
            summonerName: 'Martinounux',
            mainPosition: React.lazy(() => import('../../img/Position/Top.png')),
        };
        
    }


    render() {
        return(
            <div id="Scouting">
                <h1>SCOUTING</h1>
                <div id="border">
                    <div id="SummonerName">

                    </div>
                    <div id="positionRank">
                        <img src="../../img/Position/Top.png"/>
                    </div>
                    <div id="mostValuableRank">

                    </div>
                </div>
            </div>
        );
    }
}

export default Scouting;
